import React from 'react';
// import './ItemsList.css';

class ItemsList extends React.Component {
	render () {
		return (
			<div>
			<input className="push-textfield" placeholder="Insert item's name"/>
				<button className="push-button">Add item</button>
			</div>
		);
	}
}

export default ItemsList;
